pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import "../utils/math/SafeMath.sol";
import "../interfaces/IKIP7.sol";
import "../interfaces/IUsageFacet.sol";
import "../interfaces/IRewardFacet.sol";
import "../interfaces/IAutoHerodotusV2.sol";

contract RewardFacet is IRewardFacet {

    using SafeMath for uint256;

    string constant private KEY_VFINIX_REWARD_PER_BLOCK = "vFinix.reward_per_block";
    string constant private KEY_VFINIX_ACC_FINIX_PER_SHARE = "vFinix.acc_finix_per_share";
    string constant private KEY_VFINIX_REWARD_START_BLOCK = "vFinix.start_block";
    string constant private KEY_VFINIX_REWARD_END_BLOCK = "vFinix.bonus_end_block";
    string constant private KEY_VFINIX_USER_REWARD_DEBT = "vFinix.user_reward_debt";
    string constant private KEY_VFINIX_LAST_REWARD_PER_BLOCK = "vFinix.last_reward_per_block";

    function init (
        uint256 _rewardPerBlock,
        uint256 _startBlock,
        uint256 _bonusEndBlock
    ) external {
        LibDiamond.enforceIsContractOwner();
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_VFINIX_REWARD_START_BLOCK)),_startBlock);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_VFINIX_REWARD_PER_BLOCK)),_rewardPerBlock);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_VFINIX_REWARD_END_BLOCK)),_bonusEndBlock);
    }

    function stopReward() external {
        LibDiamond.enforceIsContractOwner();
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_VFINIX_REWARD_END_BLOCK)),block.number);
    }

    function getMultiplier(uint256 _from, uint256 _to) public view returns (uint256) {
        if (_to <= bonusEndBlock() || bonusEndBlock() == 0) {
            return _to.sub(_from);
        } else if (_from >= bonusEndBlock()) {
            return 0;
        } else {
            return bonusEndBlock().sub(_from);
        }
    }

    function pendingReward(address _user) external view returns (uint256) {
        uint256 lpSupply = IKIP7(address(this)).totalSupply();
        uint256 accFinixPerShare_ = accFinixPerShare();
        if (block.number > lastRewardBlock() && lpSupply != 0) {
            uint256 multiplier = getMultiplier(lastRewardBlock(), block.number);
            uint256 finixReward = multiplier.mul(rewardPerBlock());
            // accCakePerShare = accCakePerShare.add(cakeReward.mul(1e12).div(lpSupply));
            accFinixPerShare_ = accFinixPerShare().add(finixReward.mul(1e12).div(lpSupply));
        }
        uint256 userTotalVotes = IUsageFacet(address(this)).getTotalVotes(_user);
        if(userTotalVotes.mul(accFinixPerShare_).div(1e12) > userRewardDebt(_user)) {
            return userTotalVotes.mul(accFinixPerShare_).div(1e12).sub(userRewardDebt(_user));
        }
        return 0;
    }

    event Pending(uint256 _pending);
    event UserRewardDebt(uint256 _userRewardDebt);
    event AccFinixPerShare(uint256 _accFinixPerShare);
    event UserTotalVotes(uint256 _userTotalVotes);

    function deposit(address _user, uint256 _amount) public override {
        // LibDiamond.enforceIsContractOwner();
        require(msg.sender == address(this),"SHOULD CALL BY THIS ADDRESS");
        address FINIX = LibDiamond.getAddress(keccak256(abi.encodePacked("FINIX")));

        _updatePool();
        uint256 userTotalVotes = IUsageFacet(address(this)).getTotalVotes(_user);
        require(userTotalVotes >= _amount,"INVALID AMOUNT");
        uint256 previousAmount = userTotalVotes.sub(_amount);
        if (previousAmount > 0) {
            if(previousAmount.mul(accFinixPerShare()).div(1e12) > userRewardDebt(_user)) {
                uint256 pending = previousAmount.mul(accFinixPerShare()).div(1e12).sub(userRewardDebt(_user));
                emit Pending(pending);
                if(pending > 0) {
                    IKIP7(FINIX).transfer(_user, pending);
                }
            }
        }
        _setUserRewardDebt(_user, userTotalVotes.mul(accFinixPerShare()).div(1e12));

    }

    function harvest(address _user) public override {
        address FINIX = LibDiamond.getAddress(keccak256(abi.encodePacked("FINIX")));
        address autoHeroV2 = LibDiamond.getAddress(keccak256(abi.encodePacked("AutoHerodotusV2")));
        IAutoHerodotusV2(autoHeroV2).harvest();
        _updatePool();
        uint256 userTotalVotes = IUsageFacet(address(this)).getTotalVotes(_user);
        if (userTotalVotes > 0) {
            if(userTotalVotes.mul(accFinixPerShare()).div(1e12) > userRewardDebt(_user)) {
                uint256 pending = userTotalVotes.mul(accFinixPerShare()).div(1e12).sub(userRewardDebt(_user));
                emit Pending(pending);
                if(pending > 0) {
                    IKIP7(FINIX).transfer(_user, pending);
                }
            }
        }
        _setUserRewardDebt(_user, userTotalVotes.mul(accFinixPerShare()).div(1e12));
    }

    function updatePool() public override {
        _updatePool();
    }

    function _updatePool() internal {
        if (block.number <= lastRewardBlock()) {
            return;
        }
        uint256 lpSupply = IKIP7(address(this)).totalSupply();
        if (lastRewardBlock() == 0) { 
            _setLastRewardBlock(block.number);
            return;
        }
        uint256 multiplier = getMultiplier(lastRewardBlock(), block.number);
        uint256 finixReward = multiplier.mul(rewardPerBlock());
        _setAccFinixPerShare(accFinixPerShare().add(finixReward.mul(1e12).div(lpSupply)));
        _setLastRewardBlock(block.number);
    }


    function rewardPerBlock() public view returns(uint256) {
        return LibDiamond.getUint(keccak256(abi.encodePacked(KEY_VFINIX_REWARD_PER_BLOCK)));
    }

    function _setAccFinixPerShare(uint256 _accFinixPerShare) internal {
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_VFINIX_ACC_FINIX_PER_SHARE)),_accFinixPerShare);
    }
    function accFinixPerShare() public view returns(uint256) {
        return LibDiamond.getUint(keccak256(abi.encodePacked(KEY_VFINIX_ACC_FINIX_PER_SHARE)));
    }

    function startBlock() public view returns(uint256) {
        return LibDiamond.getUint(keccak256(abi.encodePacked(KEY_VFINIX_REWARD_START_BLOCK)));
    }

    function bonusEndBlock() public view returns(uint256) {
        return LibDiamond.getUint(keccak256(abi.encodePacked(KEY_VFINIX_REWARD_END_BLOCK)));
    }

    function _setLastRewardBlock(uint256 _lastRewardBlock) internal{
        return LibDiamond.setUint(keccak256(abi.encodePacked(KEY_VFINIX_LAST_REWARD_PER_BLOCK)),_lastRewardBlock);
    }
    function lastRewardBlock() public view returns(uint256) {
        return LibDiamond.getUint(keccak256(abi.encodePacked(KEY_VFINIX_LAST_REWARD_PER_BLOCK)));
    }

    function _setUserRewardDebt(address _user,uint256 _rewardDebt) internal {
        // KEY_VFINIX_USER_REWARD_DEBT
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_VFINIX_USER_REWARD_DEBT,_user)),_rewardDebt);
    }
    function userRewardDebt(address _user) public view returns(uint256) {
        // KEY_VFINIX_USER_REWARD_DEBT
        return LibDiamond.getUint(keccak256(abi.encodePacked(KEY_VFINIX_USER_REWARD_DEBT,_user)));
    }

}
